import './App.css';
import { ThemeProvider, Box, Container } from '@mui/system';
import { theme } from './themes/theme';

import Header from './components/Header';
import Footer from './components/Footer';
import Profile from './components/Profile';
import Resume from './pages/Resume';

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Container
        sx={{
          display: 'grid',
          gridTemplateColumns: 'repeat(4, 1fr)',
          gap: 1,
          gridTemplateRows: 'auto',
          gridTemplateAreas: `"profile header header header"
        "profile resume"
        "profile footer footer footer"`,
        }}
      >
        <Box sx={{ gridArea: 'header'}}>Header</Box>
        <Box sx={{ gridArea: 'profile'}}>Profile</Box>
        <Box sx={{ gridArea: 'resume'}}>Resume</Box>
        <Box sx={{ gridArea: 'footer'}}>Footer</Box>
      </Container>
    </ThemeProvider>
  );
}

export default App;
